import React from "react";
import { Container, Form, Navbar } from "react-bootstrap";
import { BsFillSearchHeartFill } from 'react-icons/bs';

function NavBar() {
  return (
    <Navbar expand="lg" className="bk">
      <Container>
        <Navbar.Brand href="#">
          <img src="logo.jpg" className="logo" alt="logo" />
        </Navbar.Brand>
        <div className="  nav-style  align-items-center" style={
          {
            background: "white", width: '100%', outline: 'none', border: 'none'
          }
        }>
       
        <input type="text" placeholder="ابحث" className="w-100" style={{border: 'none', height: '50px'}}/>
        <span class="icon">
        <BsFillSearchHeartFill />
         
        </span>
        </div>
      </Container>
    </Navbar>
  );
}
//            <BsFillSearchHeartFill />

export default NavBar;
